import React, { useEffect, useState } from 'react';


const BoxScoreGraph = (data) => {
    const instance = data.props;
    console.log(instance);
    console.log(instance.hls.tstsg.fgm);
    console.log(instance.vls.tstsg.fgm);
    const [ fgpHls, setFgpHls ] = useState(null);
    const [ fgpVls, setFgpVls ] = useState(null);

    useEffect(()=>{
        setFgpHls(Math.round((instance.hls.tstsg.fpm / instance.hls.tstsg.fpa) * 100) + '%');
        setFgpVls(Math.round((instance.vls.tstsg.fgm / instance.vls.tstsg.fga) * 100) + '%');

        console.log(fgpHls);
        console.log(fgpVls);
    }, []);

    return (
        <div>
            {/* <!-- Vertical, rounded --> */}

            <div className="graph-container graph-vertical graph-rounded">

                <h2>Vertical, Rounded</h2>
                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>{ fgpHls }</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>75%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>65%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>20%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>34%</span>
                        </div>
                    </div>
                </div>

                <div className="progress-bar">
                    <div className="progress-track">
                        <div className="progress-fill">
                            <span>82%</span>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    )
}

export default BoxScoreGraph;
